سلام دوستای قشنگم
مواد لازم برای این پودینگ که کاملا شبیه دسر های دنت هست:
برای طعم زعفرانی:
دو قاشق مربا خوری زعفران دم کرده
صد گرم خامه
یک قاشق چایخوری صمغ زانتان
یک قاشق غذا خوری زایلیتول یا نصف قاشق غذا خوری استویا(شیرینی بسته به ذائقه شما میتونه تغییر کنه)
دو قاشق غذا خوری گلاب
یک قاشق غذا خوری روغن بدون بوی زیتون یا ام سی تی
روش تهیه 
ابتدا خامه و زانتان و شیرین کننده و زعفران و روغن رو خیلی خوب مخلوط کنید تا به شکل پودینگ در بیاد بعد کم کم در حین هم زدن گلاب رو اضافه می کنیم ،می تونید با کمی پودر هل ططعم بهتری به دسر بدید.دسر را در ظرف مناسب بریزید و یک ساعت در یخچال استراحت دهید و سپس نوش جان کنید،دقت کنید میزان صمغ زانتان نباید بیشتر شود.
برای طعم توت فرنگی:
یک قاشق مربای توت فرنگی پوره شده(ترکیب توت فرنگی و زایلیتول)
صد گرم خامه
یک قاشق چایخوری صمغ زانتان
در صورت نیاز کمی شیرین کننده
دو قاشق آب
یک قاشق روغن زیتون بی بو یا ام سی تی
کمی اسانس وانیل
روش تهیه
خامه،زانتان،مربا و وانیل و روغن رو خوب بزنید و بعد از اینکه به شکل پودینگ درامد به آن کم کم دو قاشق آب را اضافه کنید و کامل مخلوط کنید تا یک دست شود.در ظرف مناسب بریزید و در یخچال بگذارید تا استراحت کند.
برای طعم های دیگر می تونید در روغن اسانسهای مختلف خوراکی را حل کنید و به روش بالا درستشون کنید.
نوش جان،اگر دوست داشتید لایک و کامنت و به اشتراک گذاری یادتون نره🤩😍🥰
