s, and wanting to better my life so I could live a long healthy life so I would be able to see my children grow. I am happy to report my BMI started at 42.8 and is now 20.8, which is healthy for my height of 5’2! Weight loss isn’t about just being “skinny” or image -> it’s about HEALTH! ❤️⁠
