“✨🍃🥑🥖 I know I’ve declared others salads ‘best ever’ but this one...this oooneee! Is it. 👏🏻 Think: creamy (dressing), crunchy (bread), garlicky (everything), buttery (avocado), salty (cheese), and full-on summery (season’s not over that till it’s over)! ☀️ Halloumi cheese can be purchased at Trader Joe’s (and most supermarkets — just ask if you don’t see it), and has a semi-soft and super satisfying texture. If you don’t have any on hand, sub burrata or fresh mozz! Enjoy 😘
