Butter Leaf Halloumi & Avocado Caesar w/ Sourdough Croutons 🥗
(serves one)

2 cups butter leaf lettuce
1-2 oz halloumi cheese, cut into cubes, and pan-seared
1/4 avocado, sliced
1/2 cup sourdough croutons (recipe below)
2 tablespoons shaved parmesan
1 teaspoon fresh dill, chopped
Za’atar seasoning (optional but encouraged)
2 tablespoons caesar dressing (I used @primalkitchenfoods)

Sourdough croutons 🥖
1 cup sourdough bread, cubed
1/2 tablespoon olive oil
Garlic powder, to taste
Sea salt & pepper, to taste

1. Toss bread with olive oil and season with garlic powder, sea salt, and pepper. Bake at 375F for ~10-15 mins, until perfectly crunchy/crispy. Cre @sara.haven
